import React, { useState, useEffect } from 'react';
import { getAllExperts, getAllDoctors, getAllDsps, getAllWorkplaces } from '../services/api';
import './WorkplaceRegistration.css';
import { useNavigate } from 'react-router-dom';

const WorkplaceRegistration = () => {
  const [experts, setExperts] = useState<any[]>([]);
  const [doctors, setDoctors] = useState<any[]>([]);
  const [dsps, setDsps] = useState<any[]>([]);
  const [workplaces, setWorkplaces] = useState<any[]>([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchExperts();
    fetchDoctors();
    fetchDsps();
    fetchWorkplaces();
  }, []);

  const fetchExperts = async () => {
    try {
      const data = await getAllExperts();
      setExperts(data);
    } catch (err) {
      console.error('Uzmanlar getirilirken hata oluştu:', err);
    }
  };

  const fetchDoctors = async () => {
    try {
      const data = await getAllDoctors();
      setDoctors(data);
    } catch (err) {
      console.error('Hekimler getirilirken hata oluştu:', err);
    }
  };

  const fetchDsps = async () => {
    try {
      const data = await getAllDsps();
      setDsps(data);
    } catch (err) {
      console.error('DSP\'ler getirilirken hata oluştu:', err);
    }
  };

  const fetchWorkplaces = async () => {
    try {
      const data = await getAllWorkplaces();
      setWorkplaces(data);
    } catch (err) {
      console.error('İş yerleri getirilirken hata oluştu:', err);
    }
  };

  const getRiskLevelText = (riskLevel: string) => {
    switch (riskLevel) {
      case 'low': return 'Düşük Risk';
      case 'dangerous': return 'Tehlikeli';
      case 'veryDangerous': return 'Çok Tehlikeli';
      default: return riskLevel;
    }
  };

  const handleClose = () => {
    // Redirect to dashboard
    navigate('/dashboard');
  };

  return (
    <div className="workplace-registration-container">
      <div className="window">
        <div className="window-header">
          <span>İş Yeri Kayıt</span>
          <div className="window-controls">
            <button className="window-button" onClick={handleClose}>×</button>
          </div>
        </div>
        <div className="window-content">
          {/* Registered Workplaces List - Now taking full width */}
          <div className="workplaces-list-container-full">
            <h3 className="workplaces-list-title">Kayıtlı İş Yerleri</h3>
            <div className="workplaces-table-container">
              <table className="workplaces-table">
                <thead>
                  <tr>
                    <th>İş Yeri Adı</th>
                    <th>SGK Kayıt No</th>
                    <th>Fiyat</th>
                    <th>Tehlike Sınıfı</th>
                  </tr>
                </thead>
                <tbody>
                  {workplaces.map((workplace) => (
                    <tr key={workplace.id}>
                      <td>{workplace.name}</td>
                      <td>{workplace.sskRegistrationNo}</td>
                      <td>{workplace.price}</td>
                      <td>{getRiskLevelText(workplace.riskLevel)}</td>
                    </tr>
                  ))}
                  {workplaces.length === 0 && (
                    <tr>
                      <td colSpan={4} style={{ textAlign: 'center' }}>
                        Henüz kayıtlı iş yeri bulunmamaktadır.
                      </td>
                    </tr>
                  )}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default WorkplaceRegistration;
